import YearsBlock from './yearsBlock';
import Support from './support';
import Tarifs from './tarifs';
import Team from './team';
import Comments from './comments';
import Workers from './workers';
import FAQ from './faq';
import Form from './form';


function Page() {
  return (
        <YearsBlock />,
        <Support />,
        <Tarifs />,
        <Team />,
        <Comments />,
        <Workers />,
        <FAQ />,
        <Form />
  );
}

export default Page;
